import{_ as e,o as a,c as o,O as r}from"./chunks/framework.9482e208.js";const v=JSON.parse('{"title":"§ 38.2-213 Violation of § 38.2-210 or § 38.2-211.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/38.2-213.md","filePath":"vacode/38.2-213.md"}'),t={name:"vacode/38.2-213.md"},i=r('<h1 id="§-38-2-213-violation-of-§-38-2-210-or-§-38-2-211" tabindex="-1">§ 38.2-213 Violation of § 38.2-210 or § 38.2-211. <a class="header-anchor" href="#§-38-2-213-violation-of-§-38-2-210-or-§-38-2-211" aria-label="Permalink to &quot;§ 38.2-213 Violation of § 38.2-210 or § 38.2-211.&quot;">​</a></h1><p>Any company, officer or director violating any provision of § <a href="http://law.lis.virginia.gov/vacode/38.2-210/" target="_blank" rel="noreferrer">38.2-210</a> or § <a href="http://law.lis.virginia.gov/vacode/38.2-211/" target="_blank" rel="noreferrer">38.2-211</a> shall be guilty upon conviction of a Class 1 misdemeanor. Any funds of any company invested or used in violation of either of § <a href="http://law.lis.virginia.gov/vacode/38.2-210/" target="_blank" rel="noreferrer">38.2-210</a> or § <a href="http://law.lis.virginia.gov/vacode/38.2-211/" target="_blank" rel="noreferrer">38.2-211</a> may not be reported as an admitted asset in accordance with guidance set forth in the National Association of Insurance Commissioners accounting practices and procedures manuals.</p><p>Code 1950, § 38-4.4; 1952, c. 317, § 38.1-36; 1986, c. 562; 2000, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0046" target="_blank" rel="noreferrer">46</a>.</p>',3),n=[i];function c(s,l,d,f,_,p){return a(),o("div",null,n)}const g=e(t,[["render",c]]);export{v as __pageData,g as default};
